/**
 * Created by Lenovo on 2019/8/7.
 */
import React from 'react';
import './index.css';
import backBlock from '../image/title/back-block.png';
import {defaultProps} from './defaultProps';
export default class Title extends React.Component {
    static defaultProps = defaultProps;
    constructor(props) {
        super(props);
        console.log(this);
    }
    onLeftClick() {
        const {onLeftClick} =this.props;
        if (onLeftClick) {
            onLeftClick();
        }
    }
    render() {
        const {title,prefixCls,isHome} =this.props;
        if (isHome) {
            return (
                <div className={prefixCls}>
                    <div className={prefixCls+"-warp-home"}>{title}</div>
                </div>
            )
        } else {
            return (
                <div className={prefixCls}>
                    <div className={prefixCls+"-warp"}>
                            <img src={backBlock} alt="" className={prefixCls+"-left-icon"} onClick={() => this.onLeftClick()}/>
                            <span>{title}</span>
                            <div className={prefixCls+"-right"}></div>
                    </div>
                </div>
            )
        }
    }
}
